const { v4: uuidv4 } = require("uuid"); //3ms08ss

//src2, 12ss, 2ms22ss,
let items = [
  {
    id: uuidv4(), //"abc", //11ss, 3ms08ss
    name: "ABC",
    level: 0,
  },
  {
    id: uuidv4(), //"def",
    name: "DEF",
    level: 1,
  },
  {
    id: uuidv4(), //"ghj",
    name: "GHJ",
    level: 2,
  },
  {
    id: uuidv4(), //"nkl",
    name: "NKL",
    level: 3,
  },
];

export default items;
